
create table dadoDeBaja (
	idVehiculoBaja VARCHAR(50),
	modelo VARCHAR(6),
	ano VARCHAR(6),
	motivo VARCHAR(50),
	fecha_final DATE,
	primary key (idVehiculoBaja)
);

create table enOperacion (
	idVehiculoOperacion VARCHAR(50),
	modelo VARCHAR(6),
	ano VARCHAR(6),
	primary key (idVehiculoOperacion)
);

create table vehiculo (
	modelo VARCHAR(50),
	ano VARCHAR(50),
	marca VARCHAR(50),
	refraccion VARCHAR(50),
	no_cilindros INT,
	no_puertas DECIMAL(10,2),
	primary key (modelo,ano)
);

create table miembroAsociacion (
	idmiembro VARCHAR(40),
	idvehiculo VARCHAR(40),
	first_name VARCHAR(50),
	noasociacion VARCHAR(40),
	email VARCHAR(50),
	domicilio VARCHAR(50),
	fechai DATE,
	nocelular VARCHAR(50),
	esdueno VARCHAR(50),
	eschofer VARCHAR(50),
	primary key (idmiembro)
);


create table viaja (
	idcliente VARCHAR(40),
	idvehiculo VARCHAR(40),
	destino VARCHAR(50),
	tiempo INT,
	distancia INT,
	nopasajeros INT
);

CREATE TABLE public."Estudiante"
(
    no_cuenta integer,
    nombre character varying(20),
    domicilio character varying(30),
    fotografia bytea,
    no_celular integer,
    email character varying(20),
    instituto character varying(60),
    CONSTRAINT id_estudiante_pkey PRIMARY KEY (no_cuenta)
);

create table Horario (
	iDCliente VARCHAR(40),
	horaEntrada VARCHAR(50),
	horaSalida VARCHAR(50)
);

create table Profesor (
	NoProfesor VARCHAR(40),
	Nombre VARCHAR(50),
	Domicilio VARCHAR(50),
	Fotografia VARCHAR(50),
	NoCelular VARCHAR(50),
	Email VARCHAR(50),
	Instituto VARCHAR(50)
);


